const ulStyle = {
  marginTop: "20px",
  padding: 0,
  textAlign: "right",
};
const liStyle = {
  display: "inline-block",
  paddingLeft: "20px",
  fontWeight: 500,
};

export default {
  liStyle,
  ulStyle,
};
